import "./App.css";
import Home from "./pages/views/Home";
import ChineseTrans from './components/views/ChineseTrans';
import ExportPDF from './components/views/ExportPDF';
import ImageBed from './components/views/ImageBed';
import styled from "styled-components";
import { Router, Route, Switch } from 'react-router-dom';
import { createBrowserHistory } from 'history';
const customHistory = createBrowserHistory();

const Container = styled.div`
  width: 100vw;
  height: 100vh;
`;

function App() {
  return (
    <Router history={customHistory}>
      <Switch>
        <Home path="/home" component={Home}>
          <Route path="/home/chineseTrans" component={ChineseTrans}></Route>
          <Route path="/home/exportPDF" component={ExportPDF}></Route>
          <Route path="/home/imageBed" component={ImageBed}></Route>
        </Home>
      </Switch>
    </Router>
  );
}

export default App;
